import React from "react";
import PropTypes from "prop-types";
import Link from 'next/link'
import cn from 'classnames';
import utilStyles from '../../styles/utils.module.scss';
import classes from './Header.module.scss';

const Header = () => {
  const activeStyle = { color: 'blue' };
  return (
    <header className={classes.headerContainer}>
      <Link href="/">
        <a>
          <div className={classes.logo}>
            <img src="/images/tk_logo.png" alt="Logo" />
            <div className={cn(classes.logoText, utilStyles.bold)}>Tong's{"\n"}Kitchen</div>
          </div>
        </a>
      </Link>

      <nav>
        <Link className={classes.headerLink} href="/recipes"><a>Recipes</a></Link>
        <Link className={classes.headerLink} href="/about"><a>About</a></Link>
      </nav>
    </header>
  );
};

export default Header;
